INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES ("フリーマーケットを訪れたジータが出会ったのは\n城をこっそり抜け出していたペコリーヌだった。", 8, 10118, 20063115, 91002, 1, "青空の下で謁見", 0, 2834, 7, "ペコリーヌとの出会い", 40, 5118061, "フリーマーケット会場", 2);
INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES ("ジータたちがフリーマーケットを巡っていると\n露店を出していたマホに声をかけられる。", 8, 10118, 20063115, 91002, 1, "未来の騎空団\nマスコット？", 0, 2835, 7, "マホとの出会い", 40, 5118062, "フリーマーケット会場", 2);
INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES ("ジータが騎空団への依頼を確認していると、\n高笑いをしながらアキノが現れる。", 8, 10118, 20063115, 91002, 1, "お嬢さまからの\n緊急依頼", 0, 2837, 7, "アキノとの出会い", 40, 5118063, "ランドソル市街地", 2);
INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES ("ジータたちは、フリーマーケット会場で\n少し困った様子のジュンを見かける。", 8, 10118, 20063115, 91002, 1, "黄金色の悩みごと", 0, 4108402, 18, "ジュンとの出会い", 40, 5118064, "フリーマーケット会場", 2);
INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES ("フリーマーケットの隅で開かれる格闘大会──\nそこにはカオリもいて……？", 8, 10118, 20063115, 91002, 1, "白熱！　格闘大会！", 0, 4107402, 18, "カオリとの出会い", 40, 5118065, "フリーマーケット会場", 2);
INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES ("太鼓祭を控えるオーエド町──\nジータは、困った様子のニノンと出会う。", 8, 10118, 20063115, 91002, 1, "祭り太鼓はオーエドの華", 1, 9000227, 16, "ニノンとの出会い", 40, 5118066, "オーエド町", 2);
INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES ("ビカラはイベントに出演中のスズナを見かける。\nしかし、スズナはどこか困っているようで……？", 8, 10118, 20063115, 91002, 1, "人気者は遅れて\nやってくる", 0, 2101181, 19, "スズナとの出会い", 40, 5118067, "フリーマーケット会場", 3);
INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES ("ビカラたちが街を散策していると、通りかかった\nナナカが興奮した様子で近づいてきて……？", 8, 10118, 20063115, 91002, 1, "巫女・ミーツ・魔法少女", 0, 4109402, 18, "ナナカとの出会い", 40, 5118068, "ランドソル市街地", 3);
INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES ("ネズ耳をなくしてしまい絶望するビカラ。同じ頃\nキャルとコッコロは落とし物を拾っており……", 8, 10118, 20063115, 91002, 1, "ネズ耳は二度なくなる", 0, 4305402, 18, "キャル＆コッコロとの出会い", 40, 5118069, "フリーマーケット会場", 3);
INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES ("街外れでひと休みをしていたビカラたちは、\nすっかりゴキゲンな様子のユカリと出会う。", 8, 10118, 20063115, 91002, 1, "この出会いにカンパイ！", 0, 4101402, 18, "ユカリとの出会い", 40, 5118070, "ランドソル市街地", 3);
INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES ("ビカラは、人混みに怯えるアオイを心配し、\n陽気に声をかけるも……", 8, 10118, 20063115, 91002, 1, "陰陽アンサンブル", 0, 4106402, 18, "アオイとの出会い", 40, 5118071, "ランドソル市街地", 3);
INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES ("ビカラがフリーマーケット会場を歩いていると\n占いをしていたシノブに声をかけられる。", 8, 10118, 20063115, 91002, 1, "運試し十番勝負！", 1, 2836, 7, "シノブとの出会い", 40, 5118072, "フリーマーケット会場", 3);
INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES (0, 0, 10118, 20063115, 0, 0, "彼女たちの新たな日常", 0, 0, 0, "オープニング", 0, 5118600, 0, 1);
